import "./FillID.css";
import React, { useState } from "react";
import { Link } from "react-router-dom";
import Axios from "axios";
import { useHistory } from "react-router-dom";
export const FillID = () => {
  const [enteredId, setEnteredId] = useState("");
  const [message, setMessage] = useState("");
  const history = useHistory(); // Get the history object

  const handleIdChange = (e) => {
    setEnteredId(e.target.value);
  };

  const handleCheckId = () => {
    Axios.post("http://127.0.0.1:8000/check_id_exists", {
      entered_id: enteredId,
    })
      .then((response) => {
        setMessage(response.data.message);
        if (response.data.message === "ID exists") {
          // ID exists, navigate to the next form
          history.push("/next-form"); // Replace "/next-form" with the URL of your next form
        }
      })
      .catch((error) => {
        console.error("Error checking ID:", error);
        setMessage("Error checking ID");
      });
  };

  const [popupStyle, showPopup] = useState("hide");
  const popup = () => {
    showPopup("submit-btn-popup");
    setTimeout(() => showPopup("hide"), 3000);
  };
  return (
    <>
      <div className="cover">
        <h1>Fill ID</h1>
        <input
          type="text"
          value={enteredId}
          onChange={handleIdChange}
          placeholder="Fill your's ID number"
        />
        <br />
        <Link to="./">
          <div className="submit-btn" onClick={handleCheckId}>
            Submit
          </div>
        </Link>
      </div>
      <div className={popupStyle}>
        <p>Your Id number is Failed</p>
        <p>Please check your ID number</p>
      </div>
    </>
  );
};
